import React from "react";
import styles from "./styles.module.css";

const Header = () => {
    return (
        <div className = {styles.wrapper}>
            <div  className = {styles.container}>
                <img src = "/public/logo_palpitebox.png" alt = "PalpiteBox" />
            </div>
        </div>
    )
}

export default Header;
